import React from 'react';
const AccNgoai= () => {
  return (
    <div className="accNgoai">
      <h1>Acc Ngoại</h1>
      <p>Chức năng này đang được phát triển.</p>
      <p>Vui lòng quay lại sau.</p>
    </div>
  );
}
export default AccNgoai;
